import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import ContainedButtons from "../ui/ContainedButttons";
import HomeIcon from "./HomeIcon";
import "../../../../index.css";
import Link from "@material-ui/core/Link";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    fontFamily: "Lobster",
  },
}));

export default function GenNavBar(props) {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" style={{ backgroundColor: "#f7f7f7" }}>
        <Toolbar style={{ width: "auto", height: "auto" }}>
          <div style={{ width: "7%", border: "1px solid red" }}>
            <Typography
              variant="h6"
              className={classes.title}
              style={{ textAlign: "left" }}
            >
              <Link href="/" style={{ color: "#2a6bf4" }}>
                My Portfolio
              </Link>
            </Typography>
          </div>
          <div
            style={{
              //flloat: "left",
              //marginRight: "80em",
              border: "1px solid red",
              width: "3%",
            }}
          >
            <HomeIcon style={{ color: "#2a6bf4" }}></HomeIcon>
          </div>

          <div style={{ width: "70%", border: "1px solid red" }}></div>
          <div style={{ width: "20%", border: "1px solid red" }}>
            <ContainedButtons
              signInNav={props.signInNav}
              signUpNav={props.signUpNav}
            ></ContainedButtons>
          </div>
        </Toolbar>
      </AppBar>
    </div>
  );
}
